import React from 'react';
import BlankRows from "./BlankRows";
import HistoryRow from "./HistoryRow";

function Opponent({opponentData}) {
  return <div>
      <HistoryRow opponent={"true"} history={opponentData}></HistoryRow>
      <BlankRows blankRows={6 - opponentData.length} opponent={"true"}></BlankRows>
  </div>
}

export default Opponent;
